    return (
        <table>
            {/* headers */}
            <tr>
                {headers.map(header=>{
                    return <th>{header}</th>
                })}
            </tr>
            {data.map(item=>{
                <tr>
                    {}
                </tr>
            })}
        </table>
    );
}

